pragma solidity ^0.6.0;

import "@openzeppelin/contracts/access/Ownable.sol";

contract EURO is Ownable {

    struct Match {
        string team1;
        uint8 score1;
        string team2;
        uint8 score2;
        string group;
    }

    Match[] public matches;

    event CreateMatch(string _team1, uint8 _score1, string _team2, uint8 _score2, string _group);

    function setMatch(string memory _team1, uint8 _score1, string memory _team2, uint8 _score2, string memory _group) public onlyOwner {
        matches.push(Match( _team1, _score1, _team2, _score2, _group));
        emit CreateMatch(_team1, _score1, _team2, _score2, _group);
    }

    function getSize() public view returns (uint256){
	return matches.length;
}

}
